package de.fivethree.immoapps.backend.model.report;

public class InspectionCriteriaReportModel {
    private String name;

    private String result;

    public InspectionCriteriaReportModel(String name, String result) {
        this.name = name;
        this.result = result;
    }

    public String getName() {
        return name;
    }

    public String getResult() {
        return result;
    }
}
